import './App.css';
import Welcome from './components/Welcome';
import NewDate from './components/NewDate';

function App() {
  const today = new Date(Date.now()).toLocaleDateString();
  return (
    <div className="main">
    <Welcome name="Naiara" today={today}></Welcome>
    <Welcome name="Judith" today={today}></Welcome>
    <Welcome name="thai" today={today}></Welcome>
    </div>
  );
}

export default App;
